import React from 'react'


export const Login = () => {
    return (
        <div className='loginForm'>
            <div className='LoginFormHeaing'>
                <h1>TeamUP</h1>
                <p>Please fill in all details</p>
            </div>
            <form>
                <input placeholder='Email address'/><br/>
                <input placeholder='Password'/>
            </form>
        </div>
    )
}
export default Login;
